import React, {useState} from 'react';

const useInputValue = initialValue => {
  const [value, setValue] = useState(initialValue);

  return{
    value,
    onChange: e => setValue(e.target.value)
  };

};

export default ({onSubmit}) => {
  const text = useInputValue("");

  return(
    <div>
    <form onSubmit = {e => {
      e.preventDefault();
      onSubmit(text.value);
    }}>

    <input {...text} />

    </form>

    </div>
  );
}
